import React from 'react';

const PhoneList = props => {

	let sampleData = [];
	let obj = {};
	const shortNumbers = props.shortNumbers.map(shortNumber => {
		for(let i = 0; i < props.publicNumbers.length; i++) {
		    if(shortNumber.number_id === props.publicNumbers[i].id) {
		    	obj["id"] = shortNumber.number_id;
		    	obj["short_number"] = shortNumber.short_number;
		    	obj["public_number"] = props.publicNumbers[i].number;
		        sampleData.push(obj);
		    }
		}

	});


	const display = sampleData.map(element => {
    	return (
   			<div>
        		<div className="ui center aligned grid">
      			<div className="four wide column">{element.id}</div>
		        <div className="four wide column">{element.public_number}</div>
		        <div className="four wide column">{element.short_number}</div>
		        <div className="four wide column">
		        	<button className="ui button">Delete</button>
		        		<div className="ui button" tabIndex="0">Modify</div>
		        	</div>
		      	</div>
    		</div>
    	);
	});

	return <div>{display}</div>;
};

export default PhoneList;
